pragma solidity 0.5.10;
//solium-disable-next-line no-experimental
pragma experimental ABIEncoderV2;
import "@gnosis.pm/safe-contracts/contracts/base/Module.sol";
import "@gnosis.pm/safe-contracts/contracts/base/ModuleManager.sol";
import "@gnosis.pm/safe-contracts/contracts/base/OwnerManager.sol";
import "@gnosis.pm/safe-contracts/contracts/common/Enum.sol";
import "../module-interface/ModuleInterface.sol";

/// @title Spending Limit Module - Allows to transfer limited amounts of ERC20 tokens and Ether without confirmations.
/// @author David Nicholas - <dnicholas@blockchains.com>
/// @notice This is still in development and may have edge cases not accounted for

//solium-disable-next-line blank-lines
contract FlexLimit is Module, ModuleInterface {
    string public constant NAME = "Limit Module";
    string public constant VERSION = "0.1.0";

    uint256 public constant MAX_LIMIT_NUMBER = 4;
    uint256 public startDate;

    /// @dev limits - mapping from an ERC20 token to an array of limits for that token
    mapping(address => Limit[]) public limits;

    struct Limit {
        uint256 period;
        uint256 currentPeriod;
        uint256 spent;
        uint256 limit;
    }

    event TransactionUnderLimitExecuted(
        address indexed to,
        address token,
        uint256 amount
    );

    event LimitChanged(
        address indexed token,
        uint256 oldLimit,
        uint256 newLimit
    );

    event LimitAdded(address indexed token, uint256 limit, uint256 period);
    event LimitDeleted(address indexed token, Limit limit);

    modifier indexInBounds(address token, uint256 index) {
        require(index < limits[token].length, "Index out of bounds");
        _;
    }

    /// @dev Setup function sets limit for a token
    /// @param _token ERC20 token. Ether is represented with address 0x0.
    /// @param _limit Limit structure for the token
    function setup(address _token, Limit memory _limit) public {
        setManager();
        limits[_token].push(_limit);

        //solium-disable-next-line  security/no-block-members
        startDate = block.timestamp; // solhint-disable-line not-rely-on-time

        emit LimitAdded(_token, _limit.limit, _limit.period);
    }

    /// @dev Function adds limit to a token
    /// @notice Can only be called by safe contract
    /// @param _token ERC20 token. Ether is represented with address 0x0.
    /// @param _limit Limit structure for the token
    function addLimit(address _token, Limit memory _limit) public authorized {
        require(
            limits[_token].length < MAX_LIMIT_NUMBER,
            "token has max number of limits"
        );
        limits[_token].push(_limit);

        emit LimitAdded(_token, _limit.limit, _limit.period);
    }

    /// @dev Function sets limit for a token
    /// @notice Can only be called by safe contract
    /// @param _token ERC20 token. Ether is represented with address 0x0.
    /// @param _index Index of the limit in the array
    /// @param _limit Limit of the limit to change
    /// @param _period Period of the limit to change
    function deleteLimit(
        address _token,
        uint256 _index,
        uint256 _limit,
        uint256 _period
    )
        public
        authorized //
        indexInBounds(_token, _index)
    {
        require(
            limits[_token][_index].limit == _limit &&
                limits[_token][_index].period == _period,
            "Index and limit don't match"
        );

        for (uint256 i = _index; i < limits[_token].length - 1; i++) {
            limits[_token][i] = limits[_token][i + 1];
        }

        Limit memory deletedLimit = limits[_token][limits[_token].length - 1];

        delete limits[_token][limits[_token].length - 1];
        limits[_token].length--;

        emit LimitDeleted(_token, deletedLimit);
    }

    /// @dev Function changes limit for a token
    /// @notice Can only be called by safe contract
    /// @param _token ERC20 token. Ether is represented with address 0x0.
    /// @param _index Index of the limit in the array
    /// @param _newLimit The new limit amoun to be placed on the period
    /// @param _limitAmount amount of the limit to change
    /// @param _oldPeriod Period of the limit to change
    function changeLimit(
        address _token,
        uint256 _index,
        uint256 _newLimit,
        uint256 _limitAmount,
        uint256 _oldPeriod
    )
        public
        authorized //
        indexInBounds(_token, _index)
    {
        require(
            limits[_token][_index].limit == _limitAmount &&
                limits[_token][_index].period == _oldPeriod,
            "Index and limit don't match"
        );

        Limit storage oldLimit = limits[_token][_index];

        limits[_token][_index].limit = _newLimit;
        emit LimitChanged(_token, oldLimit.limit, _newLimit);
    }

    /// @dev Returns if Safe transaction under the limit
    /// @param token Address of the token that should be transfered (0 for Ether)
    /// @param to Address to which the tokens should be transfered
    /// @param amount Amount of tokens (or Ether) that should be transfered
    /// @return Returns if transaction can be executed.
    function executeLimit(address token, address to, uint256 amount) public {
        require(
            OwnerManager(address(manager)).isOwner(msg.sender),
            "Method can only be called by an owner"
        );
        require(to != address(0), "Invalid to address provided");
        require(amount > 0, "Invalid amount provided");

        require(checkLimits(token, amount), "Over limit");

        if (token == address(0)) {
            require(
                manager.execTransactionFromModule(
                    to,
                    amount,
                    "",
                    Enum.Operation.Call
                ),
                "Could not execute ether transfer"
            );
        } else {
            bytes memory data = abi.encodeWithSignature(
                "transfer(address,uint256)",
                to,
                amount
            );
            require(
                manager.execTransactionFromModule(
                    token,
                    0,
                    data,
                    Enum.Operation.Call
                ),
                "Could not execute token transfer"
            );
        }

        emit TransactionUnderLimitExecuted(to, token, amount);
    }

    /// @param _token Address of the token that should be transfered (0 for Ether)
    /// @return Returns number of limits associated with a token
    function getNumberOfLimits(address _token) public view returns (uint256) {
        return limits[_token].length;
    }

    /// @dev Checks the limits for a token
    /// @param _token Address of the token that should be transfered
    /// @param _amount Amount of tokens (or Ether) that should be transfered
    /// @return Returns if the transaction are within the limit
    function checkLimits(address _token, uint256 _amount)
        internal
        returns (bool)
    {
        require(limits[_token].length != 0, "No limits have been set");
        for (uint256 i = 0; i < limits[_token].length; i++) {
            if (!underLimit(_token, i, _amount)) {
                return false;
            }
        }

        for (uint256 i = 0; i < limits[_token].length; i++) {
            limits[_token][i].spent += _amount;
        }

        return true;
    }

    /// @dev Returns if an amount is under a single limit
    /// @param _token Address of the token that should be transfered
    /// @param _limitIndex Index of the token in the limit array for the token
    /// @param _amount Amount of tokens (or Ether) that should be transfered
    /// @return Returns whether or not the amount can be spent within a specific limit
    function underLimit(address _token, uint256 _limitIndex, uint256 _amount)
        internal
        returns (bool)
    {
        Limit storage limit = limits[_token][_limitIndex];
        if (period(limit) > limit.currentPeriod) {
            limit.currentPeriod = period(limit);
            limit.spent = 0;
        }

        if (
            limit.spent + _amount <= limit.limit &&
            limit.spent + _amount > limit.spent
        ) {
            return true;
        }

        return false;
    }

    /// @dev Determines which period currently in.
    /// @param _limit limit who's period is being assessed
    /// @return Returns the current number of periods of the limit's period length
    function period(Limit storage _limit) internal view returns (uint256) {
        //solium-disable-next-line  security/no-block-members
        return (block.timestamp - startDate) / _limit.period; // solhint-disable-line not-rely-on-time
    }
}

